import React from 'react';
import './Card.css';
import team1 from '../img/team-1.jpg';

const Card = () => {
    return (
        <div className='team-mem'>
            <img src={team1} alt="" />
            <div className="team-box-content">
                <h2>John Doe</h2>
                <h4>Manager</h4>
            </div>
        </div>
    )
}

export default Card;
